import { React, NavLink } from "react";
const Card = (props) => {
  return (
    <>
      <div className="col-4">
        <div className="card">
          <img
            className="card-img-top"
            src={props.imgsrc}
            alt="Card image cap"
          />
          <div className="card-body">
            <h5 className="card-title">{props.title}</h5>
            <p className="card-text">{props.para}</p>
            <NavLink to="/" className="btn btn-primary">
              click me
            </NavLink>
          </div>
        </div>
      </div>
    </>
  );
};
export default Card;
